-- AUTO SUMMIT LOOP
if autoSummitBtnRef then
    autoSummitBtnRef.MouseButton1Click:Connect(function()
        if running then return end
        running=true
        coroutine.wrap(function()
            while running do
                for _,t in ipairs(trackData) do
                    if t.name~="AUTO SUMMIT" then
                        if not running then break end
                        playTrack(t.points)
                    end
                end
                wait(5)
                if player.Character and running then
                    player.Character:BreakJoints()
                    wait(5)
                end
            end
        end)()
    end)
end

